import React from "react";
import Heading from "./Heading";
import Note from "./Note";
import Footer from "./Footer";
import notes from "../notes";

function App(){
    return <div>
    <Heading />
    {notes.map(createNote => (
        <Note
          key={createNote.key}
          title={createNote.title}
          content={createNote.content}
        />
      ))}
    <Footer />
</div>
}

export default App;
